import { useState } from 'react';

const get = (url, responseData) => {
  fetch(url, {
    dataType: 'json',
    headers: { 'Content-Type': 'application/json' },
    method: 'get',
  })
    .then((result) => result.json())
    .then((result) => result.results)
    .then((result) => {
      responseData = result;
      return responseData;
    });
};

export default get;
